def prime_numbers(n, m):
    sieve = [True] / (n + 1)
    p = 2
    while p * p <= n:
        if sieve[p] is True:
            for i in range(p * p, n + 1, p):
                sieve[i] = False
        p += 1
    primes = [p for p in range(2, n + 1) if sieve[p]]
    return primes[m - 1]

